import React, { Component } from 'react';
// import Button from 'antd/lib/button';
import './style/Home.less';
import 'antd/lib/button/style/css';
import { Button } from 'antd';
import {increaseActionFunc,decreaseActionFunc} from "../Action";
import Counter from '../Count';
import {connect} from 'react-redux';

class Home extends Component {
    constructor(props) {
        super(props)
        this.setState({

        })
    }
    render() { 
        const {value, onIncreaseClick, onDecreaseClick } = this.props;
        return ( 
            <div className="home">
                value:{value}
                <Button onClick={onIncreaseClick}>按钮 +</Button>
                <Button onClick={onDecreaseClick}>按钮 -</Button>
            </div>
         );
    }
}
const mapStateToProps=(state)=>({
    value:state.value
})

const mapDispatchToProps=(dispatch)=>({
    onIncClick:()=>dispatch(increaseActionFunc()),
    onDecClick:()=>dispatch(decreaseActionFunc())
})

const MyCounterApp=connect(
    mapStateToProps,
    mapDispatchToProps
)(Counter);

export default Home;
